Progress = false; // Hide the progress indicator after closing the modal\n    }, 2000); // Replace 2000 with the time (in milliseconds) it takes to perform your additional processing\n  }\n\n}\n\n    \n\n    \n        \n\n\n  \n    \n\n  \n      \n      \n    \n\n    \n      PopulationName\n      \n    \n    \n      \n        \n          \n            Contrat Type\n            \n          \n        \n        \n          \n            Durée Travail\n            \n          \n        \n      \n    \n\n    \n      Ancienneté\n      \n    \n\n\n\n\n\n    \n      \n        Date Début\n        \n      \n      \n        Date Fin\n        \n      \n    \n\n    \n      \n        \n          \n            Categorie Socio-Professionnelle\n            \n          \n        \n        \n          \n            Department\n            \n          \n        \n        \n          \n            Genre\n            \n              --Please choose an option--\n              Homme\n              Femme\n            \n          \n        \n      \n      \n        \n          \n            Age\n            \n          \n        \n        \n          \n            Niveau Education\n            \n          \n        \n        \n          \n            Région Géographique\n            \n          \n        \n      \n\n    \n\n    \n      Register\n      Close\n\n    \n\n\n\n\n\n  \n\n  \n  \n\n\n\n\n    \n\n    \n                \n                    ./dialog-body.component.css\n                \n                .example-form {\n  min-width: 150px;\n  max-width: 600px;\n  width: 100%;\n}\n\n.example-full-width {\n  width: 100%;\n}\n\ntd {\n  padding-right: 8px;\n}\n\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TE